        <FlatList style={styles.div1Read}>
          data={clientes}

          renderItem={({ item }) => {

            return (

              // <View style={ReadStyle.card}>

              //   <View style={ReadStyle.titleCard}>
              //     <Text style={ReadStyle.titleName}>{item.idade}</Text>
              //   </View>

